import { useRouter } from "next/router";
import React, { Component } from "react";

class RefLink extends Component {
  render() {
    const router = useRouter();
    return (
      <>
        <p>Your inviter is ID {router.query.id}</p>
      </>
    );
  }
}

export default RefLink;
